void compile() {
	const string filePath="./dll.dll";

	ifstream file(filePath);
	if (file.good()){
		file.close();

		if (remove(filePath.c_str())!=0) {
			cerr<<"无法删除上次编译后的dll.dll文件！"<<endl;
		} else {
			cout<<"旧文件删除成功，正在编译新dll..."<<endl;
		}
	}
	file.close();

	system("gcc -shared -o dll.dll dll.c -s -w -static-libgcc>nul");

	ifstream compiledFile(filePath);
	if(compiledFile.good()){
		compiledFile.close();
		cout<<"新dll编译成功！"<<endl;
	}else{
		compiledFile.close();
		cerr<<"dll编译失败！"<<endl;
	}
}
void dll2shellcode(){
	const string filePath="./dll.dll";

	ifstream file(filePath);
	if (file.good()){
		file.close();
		cout<<"正在生成shellcode...\n";
		system("python ConvertToShellcode.py dll.dll>nul");
		cout<<"生成成功！\n";
	}else cout<<"dll转shellcode时找不到文件！\n";
}
void del(){
	system("del payload.bin>nul");
	system("del ConvertToShellcode.py>nul");
	system("del ShellcodeRDI.py>nul");
	system("del dll.c>nul");
	system("del dll.dll>nul");
	system("rmdir /s /q __pycache__>nul");
	system("rename dll.bin payload.bin>nul");
	cout<<"删除临时文件成功！\n";
}
